{"cells":[{"source":"<a href=\"https://www.kaggle.com/linhbui99/bellabeat-case-study?scriptVersionId=89691662\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"8a9c3dc7","metadata":{"papermill":{"duration":0.073611,"end_time":"2022-03-09T18:16:26.246405","exception":false,"start_time":"2022-03-09T18:16:26.172794","status":"completed"},"tags":[]},"source":["<h1> Bellabeat Case Study </h1>\n","<h2>How can a wellness technology company play it smart?</h2>\n","<hr>\n"," Using R Studio \n"," <hr>\n","    <b>Linh Bui </b>\n","    <hr>\n","    March 8, 2022\n","<hr>\n"]},{"cell_type":"markdown","id":"a0324264","metadata":{"papermill":{"duration":0.069682,"end_time":"2022-03-09T18:16:26.385619","exception":false,"start_time":"2022-03-09T18:16:26.315937","status":"completed"},"tags":[]},"source":["<h2>A. Introduction</h2>\n"," <h3>1. Company Overview</h3>\n","<p>\n","<a href=\"https://bellabeat.com/product/ivy/?gclid=Cj0KCQiA64GRBhCZARIsAHOLriJUeTKte3wHs4oG2wDkjM9j0MIXnN_n6Q7SAnJoqD3JeAeamqdBo0IaAqgzEALw_wcB\">Bellabeat</a> is a high-tech manufacturer of health-focus products for woman. It is a successful small company, but they have the potential to become a larger player in global <a hred=\"https://en.wikipedia.org/wiki/Smart_device\">smart device</a> market. Urska Srsen, cofounder and Chief Creative Office of Bellabeat, believes that analyzing smart device fitness data could help unlock new growth opportunities for the company. \n","</p>\n"," <h3>2. Stakeholders</h3>\n"," <ul>\n","  <li>Urška Sršen: Bellabeat’s cofounder and Chief Creative Officer</li>\n","  <li>Sando Mur: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team</li>\n","  <li>Bellabeat marketing analytics team: A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy.</li>\n","  </ul>\n"," <h3>3. Products</h3>\n"," <ul>\n","  <li>Bellabeat app: The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products.</li>\n","  <li>Leaf: Bellabeat’s classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.</li>\n","  <li>Time: This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your daily wellness.</li>\n","  <li>Spring: This is a water bottle that tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your hydration levels.</li>\n","  </ul>\n"]},{"cell_type":"markdown","id":"98a5385e","metadata":{"papermill":{"duration":0.06928,"end_time":"2022-03-09T18:16:26.524079","exception":false,"start_time":"2022-03-09T18:16:26.454799","status":"completed"},"tags":[]},"source":["<h2>B. Ask</h2>\n","The business task is to analyze decide usage data in order to gain insight into how consumers use non-Bellabeat smart devices.\n","This project delivers three perspectives:\n","<ul>\n","  <li>Some trends in smart device usage</li>\n","  <li>How these trends apply to Bellabeat customers</lo>\n","  <li>How these trends help influence Bellabeat marketing strategy</li>\n","</ul>"]},{"cell_type":"markdown","id":"6892a063","metadata":{"papermill":{"duration":0.069442,"end_time":"2022-03-09T18:16:26.66384","exception":false,"start_time":"2022-03-09T18:16:26.594398","status":"completed"},"tags":[]},"source":["<h2>C. Prepare and Process</h2>\n","<h3>1. Dataset Overview</h3>\n","<p>\n","<a href=\"https://www.kaggle.com/arashnic/fitbit\">FitBit Fitness Tracker Data</a> (CCO: Public Domain, dataset made available through Mobius) will be used to analyze throughout this project. \n","It contains personal fitness tracker from thirty fitbit users. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. It includes information about daily activity, steps, and heart rate that can be used to explore users’ habits.\n","There are 18 csv files in this dataset. \n","</p>\n","<h3>2. Process</h3>\n","Data will be processed, cleaned and manipulated using R. \n","Cleaning process: \n","<ul>\n","    <li>Importing R packages</li>\n"," "]},{"cell_type":"code","execution_count":1,"id":"fcebc65d","metadata":{"execution":{"iopub.execute_input":"2022-03-09T18:16:26.81038Z","iopub.status.busy":"2022-03-09T18:16:26.807138Z","iopub.status.idle":"2022-03-09T18:16:28.390124Z","shell.execute_reply":"2022-03-09T18:16:28.388494Z"},"papermill":{"duration":1.657356,"end_time":"2022-03-09T18:16:28.390361","exception":false,"start_time":"2022-03-09T18:16:26.733005","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ───────────────────────────