 sedentary       | 0.24242424 | 24.2% |\n","| somewhat active | 0.27272727 | 27.3% |\n","\n"],"text/plain":["  activity_type   activity_user_type_percentage percent\n","1 active          0.15151515                    15.2%  \n","2 highly active   0.06060606                    6.1%   \n","3 low active      0.27272727                    27.3%  \n","4 sedentary       0.24242424                    24.2%  \n","5 somewhat active 0.27272727                    27.3%  "]},"metadata":{},"output_type":"display_data"}],"source":["#dailyStep\n","total_daily_step<-dailySteps_merged %>% \n","  group_by(Id) %>% \n","  summarize(mean_daily_steps=mean(StepTotal))\n","\n","\n","#categorizing user type \n","activity_user_type <- total_daily_step %>% \n","  mutate(activity_type= case_when(\n","    mean_daily_steps <5000 ~ \"sedentary\",\n","    mean_daily_steps >=5000 & mean_daily_steps<=7499 ~ \"low active\",\n","    mean_daily_steps >=7500 & mean_daily_steps <=9999 ~ \"somewhat active\",\n","    mean_daily_steps >= 10000 & mean_daily_steps <= 12500 ~ \"active\", \n","    mean_daily_steps >12500 ~ \"highly active\",\n","  ))\n","\n","user_type_percentage <- activity_user_type %>% \n","  group_by (activity_type) %>% \n","  summarise(total=n()) %>% \n","  mutate(totals=sum(total)) %>% \n","  group_by(activity_type) %>% \n","  summarise(activity_user_type_percentage=(total/totals)) %>% \n","  mutate(percent=scales::percent(activity_user_type_percentage)) \n","View(user_type_percentage)"]},{"cell_type":"markdown","id":"f7980c1a","metadata":{"papermill":{"duration":0.215223,"end_time":"2022-03-09T18:16:55.076899","exception":false,"start_time":"2022-03-09T18:16:54.861676","status":"completed"},"tags":[]},"source":["A pie chart will be drawed to demonstrate user_type_percentage table "]},{"cell_type":"code","execution_count":6,"id":"54524c6a","metadata":{"execution":{"iopub.execute_input":"2022-03-09T18:16:55.506662Z","iopub.status.busy":"2022-03-09T18:16:55.504649Z","iopub.status.idle":"202