 = position_stack(vjust = 0.5))+\n","  scale_fill_brewer(\"Greens\")+\n","  guides(fill=guide_legend(title=\"Activity Type\"))"]},{"cell_type":"markdown","id":"856a0038","metadata":{"papermill":{"duration":0.211747,"end_time":"2022-03-09T18:16:56.651005","exception":false,"start_time":"2022-03-09T18:16:56.439258","status":"completed"},"tags":[]},"source":["<b>Conclusion</b>\n","<ul>\n","    <li>The sedentary user type percentage is relatively high, 24.2% </li>\n","    <li>The most popular lifestyle are low active and somewhat active, taking more than 50% </li>\n","    <li>The active and highly active lifestyle take smallest portion, only 21.3% in total</li>\n","</ul>\n","<b>Limitation:</b>\n","Counting steps is not the only method to determine types of lifestyle; while activity could be in many different forms like working out or sports. Lifestyle also varies from ages to sexes, which wasn't indicated in the dataset. "]},{"cell_type":"markdown","id":"b94c1bc7","metadata":{"papermill":{"duration":0.225612,"end_time":"2022-03-09T18:16:57.107603","exception":false,"start_time":"2022-03-09T18:16:56.881991","status":"completed"},"tags":[]},"source":["<h4>Daily Calories Burned </h4>\n","<p>\n"," According to <a href=\"https://www.livestrong.com/article/312510-how-many-calories-are-burned-daily-by-active-sedentary-people/\">livestrong.com</a> the total estimated calories burned for \n"," <ul>\n","     <li>sedentary life: 2783 calories</li>\n","     <li>active life: 4006 calories </li>\n"," </ul>\n"," \n","We will category the user into three groups:\n","<ul> \n","    <li> sedentary</li>\n","    <li>fairly active </li>\n","    <li> active </li>\n","</ul>\n"]},{"cell_type":"code","execution_count":7,"id":"e014c927","metadata":{"execution":{"iopub.execute_input":"2022-03-09T18:16:57.537728Z","iopub.status.busy":"2022-03-09T18:16:57.535849Z","iopub.status.idle":"2022-03-09T18:16:57.585922Z","shell.execute_reply":"2022-03-09T18:16:57.58441Z"},"papermill":{"duration":0.266358,"end_time":"2022-03-09T18:16:57.586101","exception":false,"start_time":"2022-03-09T18:16:57.319743","status":"completed"},"tags":[]},"outputs":[],"source":["dailyCalories_merged<-dailyCalories_merged %>% \n","  group_by(Id) %>% \n","  summarise(mean_calories=mean(Calories))\n","\n","calories_type <-dailyCalories_merged %>% \n","  mutate(type=case_when(\n","    mean_calories<= 2783 ~ \"sedentary\",\n","    mean_calories > 2783 & mean_calories < 4006 ~ \"fairly active\",\n","    mean_calories >= 4006 ~ \"active\"\n","  ))\n","\n","calories_type_percent <- calories_type %>% \n","  group_by (type) %>% \n","  summarise(total=n()) %>% \n","  mutate(totals=sum(total)) %>% \n","  group_by(type) %>% \n","  summarise(calories_type_percentage=(total/totals)) %>% \n","  mutate(percent=scales::percent(calories_type_percentage)) \n","\n","\n"]},{"cell_type":"markdown","id":"dd0b5617","metadata":{"papermill":{"duration":0.213225,"end_time":"2022-03-09T18:16:58.011376","exception":false,"start_time":"2022-03-09T18:16:57.798151","status":"completed"},"tags":[]},"source":["From the calories_type_percent table, we create a pie chart demonstrating the portion of each user type based on their daily calories. "]},{"cell_type":"code","execution_count":8,"id":"095504c3","metadata":{"execution":{"iopub.execute_input":"2022-03-09T18:16:58.440532Z","iopub.status.busy":"2022-03-09T18:16:58.439792Z","iopub.status.idle":"2022-03-09T18:16:58.768387Z","shell.execute_reply":"2022-03-09T18:16:58.766957Z"},"papermill":{"duration":0.545476,"end_time":"2022-03-09T18:16:58.768583","exception":false,"start_time":"2022-03-09T18:16:58.223107","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2AU5dqH8Xu2pRdS6L2LIB0EBBRFAbEee29wFBAUEFDs+ioeFcTeOBZsxwo2\nsCBgw4ICKr339Lp9d2beDwshpLEJSXYze/0+KJmdnbl3d5L888xTFF3XBQAAAA2fKdQFAAAA\noHYQ7AAAAAyCYAcAAGAQBDsAAACDINgBAAAYBMEOAADAIAh2AAAABkGwAwAAMAiCHQAAgEEQ\n7AAAAAyCYA