= \"%m/%d/%Y %I:%M:%S %p\" , tz=Sys.timezone()))\n","\n","hourlyIntensities_merged <- hourlyIntensities_merged %>% \n","  mutate(ActivityHour= as.POSIXct(ActivityHour, format= \"%m/%d/%Y %I:%M:%S %p\", tz=Sys.timezone()))\n","\n","\n","#merging all three hourly tables together \n","\n","merged_hourly_activity <- merge(hourlyCalories_merged, hourlySteps_merged, by=c(\"Id\", \"ActivityHour\"))\n","\n","merged_hourly_activity <- merge(merged_hourly_activity, hourlyIntensities_merged, by = c(\"Id\", \"ActivityHour\"))\n","#create a new column time \n","merged_hourly_activity$time <- format(merged_hourly_activity$ActivityHour, format= \"%H:%M\")\n","\n","mean_hourly_activity <-merged_hourly_activity %>% \n","  group_by(time) %>% \n","  summarise(mean_hourly_step=mean(StepTotal), mean_hourly_calories= mean(Calories), mean_intensity=mean(TotalIntensity))"]},{"cell_type":"code","execution_count":10,"id":"3b8b602a","metadata":{"execution":{"iopub.execute_input":"2022-03-09T18:17:01.467678Z","iopub.status.busy":"2022-03-09T18:17:01.466057Z","iopub.status.idle":"2022-03-09T18:17:02.599226Z","shell.execute_reply":"2022-03-09T18:17:02.598522Z"},"papermill":{"duration":1.353021,"end_time":"2022-03-09T18:17:02.599448","exception":false,"start_time":"2022-03-09T18:17:01.246427","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2AT5R/H8ecym6S7pWxkT9l7iWwBUVQ2ggwFZCuCAgrI3ggyBUVEZAgIgkyR\nISKKguypDGWvlrZpmya53x9XQoGOlKQp3O/9+it57sn3vkma6yeX3EWSZVkAAADg6afJ6gYA\nAADgHQQ7AAAAlSDYAQAAqATBDgAAQCUIdgAAACpBsAMAAFAJgh0AAIBKEOwAAABUgmAHZMDl\nXe2le15YdS6r2/GRH5s8o9zlmvNPPrRoU/VcqS3KVK71jv032pM6suPut7NGNHu+Us6wYINO\nHxAcXqpynR7DPjl6J8FbrQKALxHsgAxY+86Prsu/DfkqCzuB5+xxp1qXzt+676iNu/68ejsq\n0WGPibp1/I/dn417p0KeEp8fvOWaeed0Z5PJZDKZynTfm4UNA0C6dFndAPDUsMedfP/w/X/2\nUX+P/S16SNUAQxa2BE+s7dhk1Yk7QghDUOE2HV4qkjsk+vLfm79dceR6XKL1XO96r7a8uTNI\nKwkhZDkxPj5eCGFL5DcYATzRCHaAuy6uHxDjcAoh/PP7x5yPkeXEwSvP7ep