ooth(mapping=aes(x=mean_lightly_active, y=mean_asleep_time))+\n","  labs(title=\"Asleep Time vs Fairly Active Minutes\", x=\"Fairly Active Minutes\", y=\"Asleep Time\")+\n","  theme(title=element_text(face=\"bold\"))+\n","  geom_hline(yintercept=480, color=\"red\")\n"]},{"cell_type":"markdown","id":"a56900b0","metadata":{"papermill":{"duration":0.26506,"end_time":"2022-03-09T18:17:08.406949","exception":false,"start_time":"2022-03-09T18:17:08.141889","status":"completed"},"tags":[]},"source":["<b>Conclusion: </b>\n","<ol>\n","    <li>No relationship between asleep time and daily total distance </li>\n","    <li>No relationship between asleep time and daily calories burned</li>\n","    <li>No relationship between asleep time and lightly active / fairly active / highly active minutes </li>\n","    <li>A negative relationship between asleep time and sedentary minutes</li> \n","        <ul>\n","        <li> reducing the sedentary time to ensure a healthier and longer sleep</li>\n","        </ul>\n","    <li>Most of users do not get enough 8 hours sleep per night </li>\n"," </ol>\n","    \n","    "]},{"cell_type":"markdown","id":"39dcb679","metadata":{"papermill":{"duration":0.259075,"end_time":"2022-03-09T18:17:08.923272","exception":false,"start_time":"2022-03-09T18:17:08.664197","status":"completed"},"tags":[]},"source":["<h2>E. Share and Act</h2>\n","<h4>Key insights</h4>\n","<ol>\n","    <li> Users need to get more sleep as professional recommended 8 hours per night</li>\n","    <li> Reducing sedentary time is essential to pursue a healthier lifestyle and improve the quality as well as quantity of sleeptime</li>\n","    <li> People are more active during lunch hours and late afternoon</li> \n","    <li> Sedentary lifestyle percent is relatively high compared to other lifestyles </li> \n","    <li> The largest polulation is somewhat active/ lightly active/ fairly active lifestyle; while active and highly active are the smallest one </li>\n","    </ol>\n","<h4>Recommendations </h4> \n","<ol> \n","    <li> Adding features to improve the quality of sleep. It could be relaxing sounds, short podcasts or meditation practices.</li>\n","    <li> Adding notifications to notify the sleep time </li>\n","    <li> Suggesting different exercises for different time of the day with various intensity levels, which helps extend the active hours </li>\n","    <u>For example</u>: \n","    <ul>\n","        <li> low-intensity exercises for early moring and later at night like yoga, breathing exercises or short walks </li>\n","        <li> higher-intensity exercises for active hours (we have discovered earlier: 11am-1pm and 5pm-7pm) including weight lifting, jogging or playing sports </li>\n","    </ul>\n","    <li> Adding a features that keep tracking of user personal body index like weights, heights and personal information like age, sex and actvity preferences</li>\n","From there, we can create an appropriate personal activity plan for each individual, which helps encourage them to use our devices more often. \n","    </ol>\n","<h4> Implementation </h4>\n","<ol>\n","    <li>Further Analysis</li>\n","    <ul> \n","        <li>Trends related to current users at Bellabeat</li>\n","        <li>Trends in their competitors or in the wellness industry in general</li>\n","        <li>The effectiveness and efficiency of insights and recommendation to differents customer segments</li>\n","    </ul>\n","        <li>Planning</li>\n","    <ul>\n","        <li>Timeline</li>\n","        <li>Implementation Team</li>\n","    </ul>\n","    <li>Design</li>\n","    <li>Test</li>Releasing trial features or version.\n","    <li>Users' response</li> Analyzing users's response regarding the new changes and new features.\n","    <li>Improve and Repeat</li>\n","    </ol>\n","<h4> Additional Data </h4> \n","For further and more accurate analysises, additional data is required: \n","<ul> \n","    <li> Data orginially from Bellabeat about their current customer usages</li>\n","    <li> Specifying in age, sex, body mass index (BMI) and personal preperences in lifestyle</li>\n","    <li> Data about the health technology usage: could be from others competitors or from the industry in general </li>\n","    </ul>\n","    </ol>\n","    <hr> \n","<b>Let me know if there is any improvement or recommendations I could make for this project. I really appreciate for any feedback from you guys! \n","    If you like my works, please give it a vote. It would mean a lot to me. Thank you! </b>\n","    <hr>\n","    \n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":46.955359,"end_time":"2022-03-09T18:17:09.389465","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-03-09T18:16:22.434106","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}